In the United Kingdom, most Commonwealth countries, and Ireland, a CV is short (usually a maximum of two sides of A4 paper), and therefore contains only a summary of the job seeker's employment history, qualifications and some personal information. It is often updated to change the emphasis of the information according to the particular position for which the job seeker is applying.<sup id="cite_ref-UoE01_1-0">[1]</sup> Many CVs contain keywords that potential employers might pick up on and display the content in the most flattering manner, brushing over information like poor grades.

In the United States a CV is used in academic circles and medical careers as a "replacement" for a résumé and is far more comprehensive; the term <i>résumé</i> is used for most recruitment campaigns. A CV elaborates on education, publications, and other achievements to a greater degree than a résumé, but it is often expected that professionals use a short CV that highlights the current focus of their academic lives and not necessarily their full history. It was designed to help them understand what people moving between countries have to offer, while overcoming linguistic barriers.

